original_question:
مثلث $ABC$ متساوی‌الساقین است، به طوری که $AB=AC$ و ارتفاع $AM=11$ است. فرض کنید نقطه‌ای $D$ روی $\overline{AM}$ وجود دارد به طوری که $AD=10$ و $\angle BDC=3\angle BAC.$ محیط مثلث $ABC$ را بیابید.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

